import React, { useState } from 'react';
import './Squad.css';

const Squad = () => {
  const [playerInput, setPlayerInput] = useState('');
  const [playerData, setPlayerData] = useState(null);
  const [notFound, setNotFound] = useState(false);
  const [loading, setLoading] = useState(false);

  // 🔹 Cerca giocatore nel backend per nome esatto
  const cercaGiocatoreEsatto = async () => {
    const nome = playerInput.trim();
    if (!nome) return;

    setLoading(true);
    setNotFound(false);
    setPlayerData(null);

    try {
      const response = await fetch(
        `http://localhost:8000/api/players/search?name=${encodeURIComponent(nome)}`
      );

      const data = await response.json();

      // Se il backend restituisce un array di giocatori
      const trovato = data.players?.find(
        (p) => p.name.toLowerCase() === nome.toLowerCase()
      );

      if (trovato) {
        setPlayerData(trovato);
      } else {
        setNotFound(true);
      }
    } catch (err) {
      console.error('Errore nel caricamento:', err);
      setNotFound(true);
    } finally {
      setLoading(false);
    }
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter') cercaGiocatoreEsatto();
  };

  return (
    <div className="squad-container">
      <h1>📊 Ricerca Giocatore</h1>

      <input
        type="text"
        placeholder="Inserisci nome esatto (es: Sommer)"
        value={playerInput}
        onChange={(e) => setPlayerInput(e.target.value)}
        onKeyPress={handleKeyPress}
      />
      <button onClick={cercaGiocatoreEsatto}>Cerca</button>

      {loading && <p>🔄 Caricamento...</p>}
      {notFound && <p className="notfound">❌ Giocatore non trovato</p>}

      {playerData && (
        <div className="player-details">
          <h2>
            {playerData.name} ({playerData.team})
          </h2>
          <p>
            <strong>Ruolo:</strong> {playerData.role}
          </p>

          <h3>Statistiche</h3>
          <ul>
            <li>Partite giocate: {playerData.stats.pg}</li>
            <li>Media voto: {playerData.stats.mv}</li>
            <li>Media fantavoto: {playerData.stats.mfv}</li>
            <li>Ammonizioni: {playerData.stats.amm}</li>
            <li>Espulsioni: {playerData.stats.esp}</li>
            <li>xG: {playerData.fbref_data.xg}</li>
            <li>xA: {playerData.fbref_data.xg_assist}</li>
            <li>Passaggi progressivi: {playerData.fbref_data.progressive_passes}</li>

            {playerData.role === 'GK' && (
              <>
                <li>Gol subiti: {playerData.stats.gs}</li>
                <li>Rigori subiti: {playerData.stats.rig}</li>
                <li>Rigori parati: {playerData.stats.rp}</li>
                <li>Clean sheet: {playerData.fbref_data.clean_sheets || 0}</li>
              </>
            )}
          </ul>

          <p>
            <a href={playerData.url} target="_blank" rel="noreferrer">
              🔗 Scheda completa
            </a>
          </p>
        </div>
      )}
    </div>
  );
};

export default Squad;
